import React from 'react';
import { Link } from 'react-router-dom';
import './CartPage.css';


class Checkout extends React.Component {
  render() {
    const storage = JSON.parse(localStorage.getItem('cart'))
    return (
      <div>
        {storage.map(e => <div>
            <span>{e.title}</span>
            <span>{e.price}</span>
            <span>{e.total}</span>
          </div>
        )}
      </div>
    );
  }
}

export default Checkout;
